DROP SCHEMA IF EXISTS baseball CASCADE;
CREATE SCHEMA baseball;

SET search_path = baseball, public;


-- Table: baseball.user_info
-- Columns:
--    username          - The username for the account, supplied during registration.
--    registration_date - The date the user registered. Set automatically.
--    team_name       	- A user-supplied team name.
DROP TABLE IF EXISTS baseball.user_info;
CREATE TABLE baseball.user_info (
	username 		varchar(30) PRIMARY KEY,
	registration_date 	timestamp NOT NULL default current_timestamp,
	team_name 		varchar(30),
	pitcher		varchar(80) default NULL,
	catcher		varchar(80) default NULL,
	first		varchar(80) default NULL,
	second		varchar(80) default NULL,
	third		varchar(80) default NULL,
	short		varchar(80) default NULL,
	left		varchar(80) default NULL,
	mid			varchar(80) default NULL,
	right		varchar(80) default NULL
);

-- Table: baseball.authentication
-- Columns:
--    username      - The username tied to the authentication info.
--    password_hash - The hash of the user's password + salt. Expected to be SHA1.
--    salt          - The salt to use. Expected to be a SHA1 hash of a random input.
DROP TABLE IF EXISTS baseball.authentication;
CREATE TABLE baseball.authentication (
	username 	varchar(30) PRIMARY KEY,
	password_hash 	char(40) NOT NULL,
	salt 		char(40) NOT NULL,
	FOREIGN KEY (username) REFERENCES baseball.user_info(username)
);

-- Table: baseball.league
-- Columns:
--		lid 			- the id for the league
-- 		name 			- the league name
--		league_memeber	- each member in the league referencing the username
DROP TABLE IF EXISTS baseball.league;
CREATE TABLE baseball.league(
	lid serial PRIMARY KEY,
	name varchar (30),
	league_member varchar(30) REFERENCES baseball.user_info(username)
);





DROP TABLE IF EXISTS baseball.master;
CREATE TABLE baseball.master(
	lahmanID serial,
  	playerID varchar(10) NOT NULL default '',
  	managerID varchar(10) NOT NULL default '',
  	hofID varchar(10) NOT NULL default '',
  	birthYear int default NULL,
  	birthMonth int default NULL,
  	birthDay int default NULL,
  	birthCountry varchar(50) default NULL,
  	birthState char(2) default NULL,
  	birthCity varchar(50) default NULL,
  	deathYear int default NULL,
  	deathMonth int default NULL,
  	deathDay int default NULL,
  	deathCountry varchar(50) default NULL,
  	deathState char(2) default NULL,
  	deathCity varchar(50) default NULL,
  	nameFirst varchar(50) default NULL,
  	nameLast varchar(50) NOT NULL default '',
  	nameNote varchar(255) default NULL,
  	nameGiven varchar(255) default NULL,
  	nameNick varchar(255) default NULL,
  	weight int default NULL,
  	height float(5) default NULL,
  	bats varchar default NULL,
  	throws varchar(1) default NULL,
  	debut date default NULL,
  	finalGame date default NULL,
  	college varchar(50) default NULL,
  	lahman40ID varchar(9) default NULL,
  	lahman45ID varchar(9) default NULL,
  	retroID varchar(9) default NULL,
  	holtzID varchar(9) default NULL,
  	bbrefID varchar(9) default NULL,
  	PRIMARY KEY  (lahmanID, playerID)
);







