DROP TABLE IF EXISTS baseball.fielding;
CREATE TABLE baseball.fielding (
  playerID varchar(9) NOT NULL default '',
  yearID smallint NOT NULL default '0',
  stint smallint NOT NULL default '0',
  teamID char(3) NOT NULL default '',
  lgID char(2) NOT NULL default '',
  POS char(2) NOT NULL default '',
  G smallint default NULL,
  GS smallint default NULL,
  InnOuts int default NULL,
  PO smallint default NULL,
  A smallint default NULL,
  E smallint default NULL,
  DP smallint default NULL,
  PB smallint default NULL,
  WP smallint default 0,
  SB smallint default NULL,
  CS smallint default NULL,
  pickoffs smallint default 0,
  ZR float(8) default 0,
  missing_g_c smallint default NULL,
  missing_g smallint default NULL,
  PRIMARY KEY  (playerID,yearID,stint,POS)
);





